class Profile extends React.Component {
  constructor(props){
    super(props)
    this.state = { 
      name: props.user.name

    }
  }
  render(){
  return (

  	<div 
  	className="profile-modal">


  	<article 
    className=" insideCoponent shadow-3 ph4 tc w-100 mw5.5 mw6-ns center pa3 mb4  ">
  	    <Header/>     
        <Scroll>
     {
     	listsOfPosts.map((user, i) => {
      return( 
      	<Posts
      	  key={i} 
      	  id={listsOfPosts[i].id} 
      	  date={listsOfPosts[i].date}
      	  post={listsOfPosts[i].post}
      	/>
      	)})
     }
     </Scroll>
     <button onClick={toggleModal}>Return</button>
  </article>


    </div> 
  	)
}
}

export default Profile;
